import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import { Route, Routes, Navigate } from "react-router-dom";
import "./App.css";
import FixedNav from "./folders/fixed nav/fixed nav.jsx";
import SideNav from "./folders/side nav/side nav.jsx";
import LoginScreen from "./folders/login/login";
import MoviesList from "./folders/movies list/moviesList";
import NotFound from "./folders/not found/notFound";
import Movies from "./folders/all movies/movies";
import ProtectedRoute from "./common/protected route";

function App() {
  const handleLogout = async () => {
    console.log("logout");
    //const res = await handleLogout();
    localStorage.clear();
    sessionStorage.clear();
  };

  return (
    <React.Fragment>
      <div className="parent-flex">
        <Router>
          <Routes>
            <Route path="/login" element={<LoginScreen />} />
          </Routes>

          <FixedNav handleLogout={handleLogout} />

          <div className="layout">
            <SideNav />

            <main className="main" id="main">
              <Routes>
                <Route element={<ProtectedRoute />}>
                  <Route path="/movies" element={<Movies />} />
                  <Route path="/moviesList" element={<MoviesList />} />

                  <Route path="*" element={<NotFound />} />
                </Route>
              </Routes>
            </main>
          </div>
        </Router>
      </div>
    </React.Fragment>
  );
}

export default App;
